export async function seedDatabase() {
  try {
    console.log('Seeding database...');
    
    const existingChannels = await db.select().from(channels);
    
    if (existingChannels.length === 0) {
      // Insert in batches of 100
      const batchSize = 100;
      let inserted = 0;
      
      for (let i = 0; i < allChannels.length; i += batchSize) {
        const batch = allChannels.slice(i, i + batchSize);
        await db.insert(channels).values(batch);
        inserted += batch.length;
      }
      
      console.log(`Successfully seeded ${inserted} channels`);
    } else {
      console.log(`Database already contains ${existingChannels.length} channels, skipping seed`);
    }
  } catch (error) {
    console.error('Error seeding database:', error);
    throw error;
  }
}
